import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{

  render(){

    return(

      <browserRouter>
        <Navigation/>

        <Route exact to="/">
          <Home/>
        </Route>

        <Route exact to="/Signin">
          <SignIn/>
        </Route>


      </browserRouter>

      )  

  }

}

export default App;
